import React, { Component } from 'react';

class VideoPlayer extends Component {
    render() {
        return (
            <div className="offset-1 mt-4">
                <iframe width="900" height="500" className="rounded" title="Title"
                    src={`https://www.youtube.com/embed/6BYIKEH0RCQ?autoplay=1`}allow='autoplay;'>
                </iframe>
            </div>
        )
    }
}


export default VideoPlayer;
